', 'python'),
('40', 'Machine Learning for Finance in Python', 'Time series data is all around us; some examples are the weather, human behavioral patterns as consumers and members of society, and financial data. In this course, you''ll learn how to calculate technical indicators from historical stock data, and how to create features and targets out of the historical stock data. You''ll understand how to prepare our features for linear models, xgboost models, and neural network models. We will then use linear models, decision trees, random forests, and neural networks to predict the future price of stocks in the US markets. You will also learn how to evaluate the performance of the various models we train in order to optimize them, so our predictions have enough accuracy to make a stock trading strategy profitable.', 'python'),
('41', 'Defensive R Programming', 'Writing R scripts is easy. Writing good R code is hard. In this course, we''ll discuss defensive programming - a set of standard techniques that will help reduce bugs and aid working in teams. We examine techniques for avoiding common errors and also how to handle the inevitable error that arises in our code. The course will conclude looking at when to make the transition from script to project to package.', 'r'),
('42', 'Conda Essentials', 'Software is constantly evolving, so data scientists need a way to update the software they are using without breaking things that already work.  Conda is an open source, cross-platform tool for managing packages and working environments for many different programming languages.  This course explains how to use its core features to manage your software so that you and your colleagues can reproduce your working environments reliably with minimum effort.', 'shell'),
('43', 'Writing Efficient Python Code', 'As a Data Scientist, the majority of your time should be spent gleaning actionable insights from data -- not waiting for your code to finish running. Writing efficient Python code can help reduce runtime and save computational resources, ultimately freeing you up to do the things you love as a Data Scientist. In this course, you''ll learn how to use Python''s built-in data structures, functions, and modules to write cleaner, faster, and more efficient code. We''ll explore how to time and profile code in order to find bottlenecks. Then, you''ll practice eliminating these bottlenecks, and other bad design patterns, using Python''s Standard Library, NumPy, and pandas. After completing this course, you''ll have the necessary tools to start writing efficient Python code!', 'python'),
('44', 'Introduction to Data Science in Python', 'Begin your journey into Data Science! Even if you''ve never written a line of code in your life, you''ll be able to follow this course and witness the power of Python to perform Data Science. You''ll use data to solve the mystery of Bayes, the kidnapped Golden Retriever, and along the way you''ll become familiar with basic Python syntax and popular Data Science modules like Matplotlib (for charts and graphs) and Pandas (for tabular data).', 'python'),
('45', 'Multiple and Logistic Regression', 'In this course you''ll take your skills with simple linear regression to the next level. By learning multiple and logistic regression techniques you will gain the skills to model and predict both numeric and categorical outcomes using multiple input variables. You''ll also learn how to fit, visualize, and interpret these models. Then you''ll apply your skills to learn about Italian restaurants in New York City!', 'r'),
('46', 'Designing and Analyzing Clinical Trials in R', 'Clinical trials are scientific experiments that are conducted to assess whether treatments are effective and safe. They are used by a variety of organizations, including pharmaceutical companies for drug development. Biostatisticians play a key role in ensuring the success of a clinical trial. In this course you will gain an overview of the important principles and a practical introduction to commonly used statistical analyses. This course would be valuable for data analysts, medical students, clinicians, medical researchers and others interested in learning about the design and analysis of clinical trials.', 'r'),
('47', 'Foundations of Inference', 'One of the foundational aspects of statistical analysis is inference, or the process of drawing conclusions about a larger population from a sample of data. Although counter intuitive, the standard practice is to attempt to disprove a research claim that is not of interest. For example, to show that one medical treatment is better than another, we can assume that the two treatments lead to equal survival rates only to then be disproved by the data. Additionally, we introduce the idea of a p-value, or the degree of disagreement between the data and the hypothesis. We also dive into confidence intervals, which measure the magnitude of the effect of interest (e.g. how much better one treatment is than another).', 'r'),
('48', 'Data Manipulation in R with data.table', 'The data.table package provides a high-performance version of base R''s data.frame with syntax and feature enhancements for ease of use, convenience and programming speed. This course shows you how to create, subset, and manipulate data.tables. You''ll also learn about the database-inspired features of data.tables, including built-in groupwise operations. The course concludes with fast methods of importing and exporting tabular text data such as CSV files. Upon completion of the course, you will be able to use data.table in R for a more efficient manipulation and analysis process. Throughout the course you''ll explore the San Francisco Bay Area bike share trip dataset from 2014.', 'r'),
('49', 'Marketing Analytics in R: Statistical Modeling', 'This is your chance to dive into the worlds of marketing and business analytics using R. Day by day, there are a multitude of decisions that companies have to face. With the help of statistical models, you''re going to be able to support the business decision-making process based on data, not your gut feeling. Let us show you what a great impact statistical modeling can have on the performance of businesses. You''re going to learn about and apply strategies to communicate your results and help them make a difference.', 'r'),
('50', 'Machine Learning Toolbox', 'Machine learning is the study and application of algorithms that learn from and make predictions on data. From search results to self-driving cars, it has manifested itself in all areas of our lives and is one of the most exciting and fast growing fields of research in the world of data science. This course teaches the big ideas in machine learning: how to build and evaluate predictive models, how to tune them for optimal performance, how to preprocess data for better results, and much more. The popular <code>caret</code> R package, which provides a consistent interface to all of R''s most powerful machine learning facilities, is used throughout the course.', 'r'),
('51', 'Data Manipulation in R with dplyr', 'In this interactive tutorial, you will learn how to perform sophisticated dplyr techniques to carry out your data manipulation with R. First you will master the five verbs of R data manipulation with dplyr: select, mutate, filter, arrange and summarise. Next, you will learn how you can chain your dplyr operations using the pipe operator of the magrittr package. In the final section, the focus is on practicing how to subset your data using the group_by function, and how you can access data stored outside of R in a database. All said and done, you will be familiar with data manipulation tools and techniques that will allow you to efficiently manipulate data.', 'r'),
('52', 'Feature Engineering for NLP in Python', 'In this course, you will learn techniques that will allow you to extract useful information from text and process them into a format suitable for applying ML models. More specifically, you will learn about POS tagging, named entity recognition, readability scores, the n-gram and tf-idf models, and how to implement them using scikit-learn and spaCy. You will also learn to compute how similar two documents are to each other.  In the process, you will predict the sentiment of movie reviews and build movie and Ted Talk recommenders. Following the course, you will be able to engineer critical features out of any text and solve some of the most challenging problems in data science!', 'python'),
('53', 'Interactive Data Visualization with plotly in R', 'Interactive graphics allow you to manipulate plotted data to gain further insight. As an example, an interactive graphic would allow you to zoom in on a subset of your data without the need to create a new plot. In this course, you will learn how to create and customize interactive graphics in plotly using the R programming language. Along the way, you will review data visualization best practices and be introduced to new plot types such as scatterplot matrices and binned scatterplots.', 'r'),
('54', 'Improving Query Performance in SQL Server', 'A mission critical assignment is depending on your SQL coding skills. You’ve been given some code to fix.  It is giving the results you need but it’s running too slow, and it’s poorly formatted making it hard to read.  The deadline is tomorrow.  You’ll need to reformat the code and try different methods to improve performance.  The pressure is on!!!  In this course we’ll be using SQL on real world datasets, from sports and geoscience, to look at good coding practices and different ways how we can can improve the performance of queries to achieve the same outcome.', 'sql'),
('55', 'Inference for Linear Regression', 'Previously, you learned the fundamentals of both statistical inference and linear models; now, the next step is to put them together.  This course gives you a chance to think about how different samples can produce different linear models, where your goal is to understand the underlying population model.  From the estimated linear model, you will learn how to create interval estimates for the effect size as well as how to determine if the effect is significant.  Prediction intervals for the response variable will be contrasted with estimates of the average response. Throughout the course, you''ll gain more practice with the dplyr and ggplot2 packages, and you will learn about the broom package for tidying models; all three packages are invaluable in data science.', 'r'),
('56', 'Extreme Gradient Boosting with XGBoost', 'Do you know the basics of supervised learning and want to learn to use state-of-the-art models on real-world datasets? Gradient boosting is currently one of the most popular techniques for efficient modeling of tabular datasets of all sizes. XGboost is a very fast, scalable implementation of gradient boosting that has taken data science by storm, with models using XGBoost regularly winning many online data science competitions  and used at scale across different industries. In this course, you''ll learn how to use this powerful library alongside pandas  and scikit-learn to build and tune supervised learning models. You''ll work with real-world datasets to solve classification as well as regression problems.', 'python'),
('57', 'Statistical Modeling in R (Part 2)', '<i>Statistical Modeling in R</i> is a multi-part course designed to get you up to speed with the most important and powerful methodologies in statistics. In <i>Part 2</i>, we''ll take a look at effect size and interaction, the concepts of total and partial change, sampling variability and mathematical transforms, and the implications of something called collinearity. This course has been written from scratch, specifically for DataCamp users. As you''ll see, by using computing and concepts from machine learning, we''ll be able to leapfrog many of the marginal and esoteric topics encountered in traditional ''regression'' courses.', NULL),
('58', 'Introduction to Text Analysis in R', 'From social media to product reviews, text is an increasingly important type of data across applications, including in marketing analytics. In many instances, text is replacing other forms of unstructured data due to how inexpensive and current it is. However, to take advantage of everything that text has to offer, you need to know how to think about, clean, summarize, and model text. In Introduction to Text Analysis in R, you will use the latest tidy tools to quickly and easily get started with text. You will learn how to wrangle and visualize text, perform sentiment analysis, and run and interpret topic models.', 'r'),
('59', 'Visualizing Geospatial Data in Python', 'One of the most important tasks of a data scientist is to understand the relationships between their data''s physical location and their geographical context. In this course you''ll be learning to make attractive visualizations of geospatial data with the GeoPandas package. You will learn to spatially join datasets, linking data to context. Finally you will learn to overlay geospatial data to maps to add even more spatial cues to your work. You will use several datasets from the City of Nashville''s open data portal to find out where the chickens are in Nashville, which neighborhood has the most public art, and more!', 'python'),
('60', 'Data Science for Managers', 'What is data science and how can you use it to strengthen your organization? This course will teach you about the skills you need on your data team, and how you can structure that team to meet your organization''s needs. Data is everywhere! This course will provide you with an understanding of data sources your company can use and how to store that data. You''ll also discover ways to analyze and visualize your data through dashboards and A/B tests. To wrap up the course, we''ll discuss exciting topics in machine learning, including clustering, time series prediction, natural language processing (NLP), deep learning, and explainable AI! Along the way, you''ll learn about a variety of real-world applications of data science and gain a better understanding of these concepts through practical exercises.', 'r'),
('61', 'Manipulating Time Series Data in R: Case Studies', 'This follow-up course on manipulating time series data in R does not cover new data manipulation concepts. Instead, you will strengthen your knowledge of the topics covered in Manipulating Time Series Data in R with xts & zoo using new exercises and interesting datasets.
', 'r'),
('62', 'Intermediate Spreadsheets for Data Science', 'This course will expand your Google Sheets vocabulary. You''ll dive deeper into data types, practice manipulating numeric and logical data, explore missing data and error types, and calculate some summary statistics. As you go, you''ll explore datasets on 100m sprint world records, asteroid close encounters, benefit claims, and butterflies.', 'spreadsheets'),
('63', 'Human Resources Analytics in R: Predicting Employee Churn', 'Organizational growth largely depends on staff retention. Losing employees frequently impacts the morale of the organization and hiring new employees is more expensive than retaining existing ones. Good news is that organizations can increase employee retention using data-driven intervention strategies. This course focuses on data acquisition from multiple HR sources, exploring and deriving new features, building and validating a logistic regression model, and finally, show how to calculate ROI for a potential retention strategy. ', 'r'),
('64', 'Importing Data in R (Part 1)', '<p>Importing data into R to start your analyses—it should be the easiest step. Unfortunately, this is almost never the case. Data come in all sorts of formats, ranging from CSV and text files and statistical software files to databases and HTML data. Knowing which approach to use is key to getting started with the actual analysis.</p><p>In this course, you will get started with learning how to read CSV and text files in R. You will then cover the readr and data.table packages to easily and efficiently import flat file data.  After that you will learn how to read XLS files in R using readxl and gdata.</p>', 'r'),
('65', 'Foundations of Functional Programming with purrr', 'Lists can be difficult to both understand and manipulate, but they can pack a ton of information and are very powerful. In this course, you will learn to easily extract, summarize, and manipulate lists and how to export the data to your desired object, be it another list, a vector, or even something else! Throughout the course, you will work with the purrr package and a variety of datasets from the repurrrsive package, including data from Star Wars and Wes Anderson films and data collected about GitHub users and GitHub repos. Following this course, your list skills will be purrrfect!', 'r'),
('66', 'Visualizing Time Series Data in Python', 'Time series data is omnipresent in the field of Data Science. Whether it is analyzing business trends, forecasting company revenue or exploring customer behavior, every data scientist is likely to encounter time series data at some point during their work. To get you started on working with time series data, this course will provide practical knowledge on visualizing time series data using Python.', 'python'),
('67', 'Forecasting Using ARIMA Models in Python', 'Have you ever tried to predict the future? What lies ahead is a mystery which is usually only solved by waiting. In this course, you will stop waiting and learn to use the powerful ARIMA  class models to forecast the future. You will learn how to use the statsmodels package to analyze time series, to build tailored models, and to forecast under uncertainty. How will the stock market move in the next 24 hours? How will the levels of CO2 change in the next decade? How many earthquakes will there be next year? You will learn to solve all these problems and more.', 'python'),
('68', 'Analyzing Business Data in SQL', 'Businesses nowadays track data on everything, from operations to marketing to HR. Leveraging this data enables businesses to understand themselves and their customers, leading to higher profits and better performance. In this course, you’ll learn about the key metrics that businesses use to measure performance. You''ll write SQL queries to calculate these metrics and produce report-ready results. Throughout the course, you''ll study the data of Delivr, a fictional food delivery startup; this data is modeled on real companies'' datasets.', 'sql'),
('69', 'Statistical Simulation in Python', 'Simulations are a class of computational algorithms that use the relatively simple idea of random sampling to solve increasingly complex problems. Although they have been around for ages, they have gained in popularity recently due to the rise in computational power and have seen applications in multiple domains including Artificial Intelligence, Physics, Computational Biology and Finance just to name a few. Students will use simulations to generate and analyze data over different probability distributions using the important NumPy package. This course will give students hands-on experience with simulations using simple, real-world applications.', 'python'),
('70', 'Introduction to Relational Databases in SQL', 'You have already used SQL for querying data from databases. But did you actually know that there''s a whole lot more you can do with databases? You can model different phenomena in your data – and relationships between them. This gives your data structure as well as consistency, which results in better data quality. In this course, you''ll experience this firsthand by working with a real-life data set that was used to investigate questionable affiliations of universities. Column by column, table by table, you''ll get to unlock and admire the full potential of databases. In between, you''ll learn how to create tables and specify their relationships as well as how to enforce data integrity. Also, you''ll discover other unique features of database systems, such as constraints.', 'sql'),
('71', 'Differential Expression Analysis in R with limma', 'Functional genomic technologies like microarrays, sequencing, and mass spectrometry enable scientists to gather unbiased measurements of gene expression levels on a genome-wide scale. Whether you are generating your own data or want to explore the large number of publicly available data sets, you will first need to learn how to analyze these types of experiments. In this course, you will be taught how to use the versatile R/Bioconductor package limma to perform a differential expression analysis on the most common experimental designs. Furthermore, you will learn how to pre-process the data, identify and correct for batch effects, visually assess the results, and perform enrichment testing. After completing this course, you will have general analysis strategies for gaining insight from any functional genomics study.', 'r'),
('72', 'Natural Language Processing Fundamentals in Python', 'In this course, you''ll learn Natural Language Processing (NLP) basics, such as how to identify and separate words, how to extract topics in a text, and how to build your own fake news classifier. You''ll also learn how to use basic libraries such as NLTK, alongside libraries which utilize deep learning to solve common NLP problems. This course will give you the foundation to process and parse text as you move forward in your Python learning.', 'python'),
('73', 'Financial Trading in R', 'This course will cover the basics on financial trading and will give you an overview of how to use quantstrat to build signal-based trading strategies in R. It will teach you how to set up a quantstrat strategy, apply transformations of market data called indicators, create signals based on the interactions of those indicators, and even simulate orders. Lastly, it will explain how to analyze your results both from statistical and visual perspectives.', NULL),
('74', 'Valuation of Life Insurance Products in R', 'Understanding the basic principles of life insurance products is essential for your personal financial planning, ranging from taking out a mortgage to designing your retirement plan and seeking financial protection for the risk of dying early. In this course, you''ll study the time value of money and you’ll work with human mortality data to derive demographic markers (such as the life expectancy). Combining the basics of cash flow valuation with the calculation of survival and death probabilities in R will allow you to construct insightful tools to design life insurance products. You''ll come out of this course understanding the valuation of life contingent claims: life annuities, which provide an income upon survival, and life insurance products, which pay a benefit upon death of the policyholder.', 'r'),
('75', 'Data Visualization with Seaborn', 'Do you want to make beautiful, informative visualizations with ease? If so, then you must learn seaborn! Seaborn is a visualization library that is an essential part of the python data science toolkit. In this course, you will learn how to use seaborn''s sophisticated visualization tools to analyze multiple real world datasets including the American Housing Survey, college tuition data, and guests from the popular television series, The Daily Show. Following this course, you will be able to use seaborn functions to visualize your data in several different formats and customize seaborn plots for your unique needs.', 'python'),
('76', 'Interactive Maps with leaflet in R', 'Get ready to have some fun with maps! Interactive Maps with leaflet in R will give you the tools to make attractive and interactive web maps using spatial data and the tidyverse. In this course, you will create maps using the IPEDS dataset, which contains data on U.S. colleges and universities. Along the way, you will customize our maps using labels, popups, and custom markers, and add layers to enhance interactivity. Following the course, you will be able to create and customize your own interactive web maps to reveal patterns in your data.', 'r'),
('77', 'Intro to Statistics with R: Moderation and Mediation', 'Moderation and mediation sound alike, but in reality they are quite different. This course will get you acquainted with these complex analytical techniques based on multiple regression. Special attention will go to centering predictors as a way to improve interpretability of results.', NULL),
('78', 'Network Analysis in Python (Part 2)', 'Have you taken DataCamp''s Network Analysis in Python (Part 1) course and are yearning to learn more sophisticated techniques to analyze your networks, whether they be social, transportation, or biological? Then this is the course for you! Herein, you''ll build on your knowledge and skills to tackle more advanced problems in network analytics! You''ll gain the conceptual and practical skills to analyze evolving time series of networks, learn about bipartite graphs, and how to use bipartite graphs in product recommendation systems. You''ll also learn about graph projections, why they''re so useful in Data Science, and figure out the best ways to store and load graph data from files. You''ll consolidate all of this knowledge in a final chapter case study, in which you''ll analyze a forum dataset and come out of this course a Pythonista Network Analyst ninja!', 'python'),
('79', 'Developing R Packages', 'In this course, you will learn the end-to-end process for creating an R package from scratch.  You will start off by  creating the basic structure for your package, and adding in important details like functions and metadata.  Once the basic components of your package are in place, you will learn about how to document your package, and why this is important for creating quality packages that other people - as well as your future self - can use with ease.  Once you have created the components of your package, you will learn how to test they work properly, by creating tests, running checks, and building your package.  By the end of this course you can expect to have all the necessary skills to create and share your own R packages.', 'r'),
('80', 'String Manipulation in R with stringr', 'Character strings can turn up in all stages of a data science project. You might have to clean messy string input before analysis, extract data that is embedded in text or automatically turn numeric results into a sentence to include in a report. Perhaps the strings themselves are the data of interest, and you need to detect and match patterns within them. This course will help you master these tasks by teaching you how to pull strings apart, put them back together and use stringr to detect, extract, match and split strings using regular expressions, a powerful way to express patterns.', 'r'),
('81', 'Exploratory Data Analysis in R: Case Study', 'Once you''ve started learning tools for data manipulation and visualization like dplyr and ggplot2, this course gives you a chance to use them in action on a real dataset. You''ll explore the historical voting of the United Nations General Assembly, including analyzing differences in voting between countries, across time, and among international issues. In the process you''ll gain more practice with the dplyr and ggplot2 packages, learn about the broom package for tidying model output, and experience the kind of start-to-finish exploratory analysis common in data science.', 'r'),
('82', 'Conda for Building & Distributing Packages', 'Now that you''re proficient in many areas of data science with Python it''s time to share your code and data with others. In this course you''ll learn the fundamentals of sharing your data science assets. You''ll learn how to leverage Anaconda Projects to package data, code, and conda environments into a single archive for other data scientists to run. You''ll learn the basics of creating Python packages that provide importable modules. Finally, you''ll learn how to write Conda recipes for your packages, build them, and share them on Anaconda Cloud.', 'shell'),
('83', 'Course Creation at DataCamp', 'Welcome to the DataCamp family! You are about to begin creating a course that, in just a few months, will be available to over 3 million students worldwide! If you''re new to eLearning, you''ll soon learn that teaching an online course is very different from teaching in a classroom. But we''re here to help! This course will provide a guide to the DataCamp Course Creation process; an introduction to the tools we use, including GitHub, Asana, and our very own course editor; and the different types of exercises and slides you can use, and how to make sure you''re reaching students at the other end of the screen. While creating your course, you will find you have other questions, such as, "How will my course be marketed?", "How do I recommend other instructors to DataCamp?", or "When do I get paid?". This course will also provide you with direction on where to find answers to all your questions. Following this course, you should be familiar with the DataCamp Course Creation process and be ready to start your very own DataCamp course. Have fun and see you in the course!', 'r'),
('84', 'Supervised Learning in R: Regression', 'From a machine learning perspective, regression is the task of predicting numerical outcomes from various inputs. In this course, you''ll learn about different regression models, how to train these models in R, how to evaluate the models you train and use them to make predictions.', 'r'),
('85', 'Bond Valuation and Analysis in R', '<p>After this course on quantitative finance with R, you will be able to use R to develop a model to value a fixed interest rate bond, estimate and analyze a bond''s yield (i.e., a measure of the opportunity cost of bond investors), and model techniques used to protect bond portfolios from changes in interest rates.</p> <p><strong>Why value bonds?</strong><br>Bonds are securities issued by governments or corporations that pay interest over a fixed schedule and are the most well-known type of fixed income securities. The US fixed income market is 1.5x larger than the US stock market, but, unlike stocks, most fixed income instruments, including bonds, trade very infrequently. Consequently, a bond''s price may be a less reliable indicator of its value and analytical techniques are necessary when analyzing and valuing bonds.</p>', 'r'),
('86', 'Building Recommendation Engines with PySpark', 'This course will show you how to build  recommendation engines using Alternating Least Squares in PySpark. Using the popular MovieLens dataset and the Million Songs dataset, this course will take you step by step through the intuition of the Alternating Least Squares algorithm as well as the code to train, test and implement ALS models on various types of customer data. ', 'python'),
('87', 'Introduction to Spark in R using sparklyr', 'R is mostly optimized to help you write data analysis code quickly and readably. Apache Spark is designed to analyze huge datasets quickly. The <code>sparklyr</code> package lets you write <code>dplyr</code> R code that runs on a Spark cluster, giving you the best of both worlds. This course teaches you how to manipulate Spark DataFrames using both the <code>dplyr</code> interface and the native interface to Spark, as well as trying machine learning techniques. Throughout the course, you''ll explore the Million Song Dataset.', 'r'),
('88', 'Python for R Users', 'Python and R have seen immense growth in popularity in the "Machine Learning Age". They both are high-level languages that are easy to learn and write. The language you use will depend on your background and field of study and work. R is a language made by and for statisticians, whereas Python is a more general purpose programming language. Regardless of the background, there will be times when a particular algorithm is implemented in one language and not the other, a feature is better documented, or simply, the tutorial you found online uses Python instead of R.

In either case, this would require the R user to work in Python to get his/her work done, or try to understand how something is implemented in Python for it to be translated into R. This course helps you cross the R-Python language barrier.', 'python'),
('89', 'RNA-Seq Differential Expression Analysis', 'RNA-Seq is an exciting next-generation sequencing method used for identifying genes and pathways underlying particular diseases or conditions. As high-throughput sequencing becomes more affordable and accessible to a wider community of researchers, the knowledge to analyze this data is becoming an increasingly valuable skill. Join us in learning about the RNA-Seq workflow and discovering how to identify which genes and biological processes may be important for your condition of interest! We will start the course with a brief overview of the RNA-Seq workflow with an emphasis on differential expression (DE) analysis. Starting with the counts for each gene, the course will cover how to prepare data for DE analysis, assess the quality of the count data, and identify outliers and detect major sources of variation in the data. The DESeq2 R package will be used to model the count data using a negative binomial model and test for differentially expressed genes. Visualization of the results with heatmaps and volcano plots will be performed and the significant differentially expressed genes will be identified and saved.', 'r'),
('90', 'pandas Foundations', 'Pandas DataFrames are the most widely used in-memory representation of complex data collections within Python.  Whether in finance, scientific fields, or data science, a familiarity with Pandas is essential.  This course teaches you to work with real-world data sets containing both string and numeric data, often structured around time series.  You will learn powerful analysis, selection, and visualization techniques in this course.', 'python'),
('92', 'Foundations of Predictive Analytics in Python (Part 2)', 'Building good models only succeeds if you have a decent base table to start with. In this course you will learn how to construct a good base table, create variables and prepare your data for modeling. We finish with advanced topics on the matter. If you have not already, you should take <a href="https://www.datacamp.com/courses/foundations-of-predictive-analytics-in-python-part-1" target="_blank">Foundations of Predictive Analytics in Python (Part 1)</a> first.', 'python'),
('93', 'Python for MATLAB Users', 'Python is a versatile programming language that is becoming more and more popular for doing data science. Companies worldwide are using Python to harvest insights from their data and get a competitive edge. This course focuses on helping Matlab users learn to use Python specifically for data science. You will quickly learn how to migrate from Matlab to Python for data analysis and visualization. Learn the fundamentals of Python syntax, how to use numpy arrays to store and manipulate data. You will learn how to use matplotlib to discover trends, correlations, and patterns in real datasets, including bicycle traffic in the city of Seattle and avocado prices across the United States.', 'python'),
('94', 'Sentiment Analysis in R: The Tidy Way', 'Text datasets are diverse and ubiquitous, and sentiment analysis provides an approach to understand the attitudes and opinions expressed in these texts. In this course, you will develop your text mining skills using tidy data principles. You will apply these skills by performing sentiment analysis in several case studies, on text data from Twitter to TV news to Shakespeare. These case studies will allow you to practice important data handling skills, learn about the ways sentiment analysis can be applied, and extract relevant insights from real-world data.', 'r'),
('95', 'Python Data Science Toolbox (Part 2)', 'In this second course in the Python Data Science Toolbox, you''ll continue to build your Python Data Science skills. First you''ll enter the wonderful world of iterators, objects that you have already encountered in the context of for loops without having necessarily known it. You''ll then learn about list comprehensions, which are extremely handy tools that form a basic component in the toolbox of all modern Data Scientists working in Python. You''ll end the course by working through a case study in which you''ll apply all of the techniques you learned both in this course as well as the prequel. If you''re looking to make it as a Pythonista Data Science ninja, you have come to the right place.', 'python'),
('96', 'Intro to SQL for Data Science', 'The role of a data scientist is to turn raw data into actionable insights. Much of the world''s raw data&ndash;from electronic medical records to customer transaction histories&ndash;lives in organized collections of tables called <em>relational databases</em>. Therefore, to be an effective data scientist, you must know how to wrangle and extract data from these databases using a language called SQL (pronounced <em>ess-cue-ell</em>, or <em>sequel</em>). This course teaches syntax in SQL shared by many types of databases, such as PostgreSQL, MySQL, SQL Server, and Oracle.This course teaches you everything you need to know to begin working with databases today!', 'sql'),
('97', 'Foundations of Predictive Analytics in Python (Part 1)', 'In this course, you will learn how to build a logistic regression model with meaningful variables. You will also learn how to use this model to make predictions and how to present it and its performance to business stakeholders.', 'python'),
('98', 'Building Chatbots in Python', 'When done well, interacting with a computer through human language is incredibly powerful and also quite fun. Messaging and Voice-Controlled devices are the next big platforms, and conversational computing has a big role to play in creating engaging augmented and virtual reality experiences. This course will get you started on the path towards building such applications! There are a number of unique challenges to building these kinds of programs. The most obvious one is of course - how do I turn human language into machine instructions? In this course, you''ll tackle this first with rule-based systems and then with machine learning. Some chat systems are designed to be useful, while others are just good fun. You will build one of each, and finally put everything together to make a helpful, friendly chatbot! And once you complete the course, you can learn how to <a href="https://www.datacamp.com/community/tutorials/facebook-chatbot-python-deploy" target="_blank">connect your chatbot to Facebook Messenger!</a>', 'python'),
('99', 'Predictive Analytics using Networked Data in R', 'In this course, you will learn to perform state-of-the art predictive analytics using networked data in R.  The aim of network analytics is to predict to which class a network node belongs, such as churner or not, fraudster or not, defaulter or not, etc.  To accomplish this, we discuss how to leverage information from the network and its underlying structure in a predictive way.  More specifically, we introduce the idea of featurization such that network features can be added to non-network features as such boosting the performance of any resulting analytical model.  In this course, you will use the igraph package to generate and label a network of customers in a churn setting and learn about the foundations of network learning. Then, you will learn about homophily, dyadicity and heterophilicty, and how these can be used to get key exploratory insights in your network. Next, you will use the functionality of the igraph package to compute various network features to calculate both node-centric as well as neighbor based network features.  Furthermore, you will use the Google PageRank algorithm to compute network features and empirically validate their predictive power. Finally, we teach you how to generate a flat dataset from the network and analyze it using logistic regression and random forests.', 'r'),
('100', 'Working with Dates and Times in Python', 'You''ll probably never have a time machine, but how about a machine for analyzing time? As soon as time enters any analysis, things can get weird. It''s easy to get tripped up on day and month boundaries, time zones, daylight saving time, and all sorts of other things that can confuse the unprepared. If you''re going to do any kind of analysis involving time, you’ll want to use Python to sort it out. Working with data sets on hurricanes and bike trips, we’ll cover counting events, figuring out how much time has elapsed between events and plotting data over time. You''ll work in both standard Python and in Pandas, and we''ll touch on the dateutil library, the only timezone library endorsed by the official Python documentation. After this course, you''ll confidently handle date and time data in any format like a champion.', 'python');






























































